import { HomePage } from './pages/home-page/home-page/home-page.component';
import { OrderPage } from './pages/order-page/order-page/order-page.component';
import { AboutPage } from './pages/about-page/about-page/about-page.component';
import { CreateCustomerSection } from './pages/order-page/sections/create-customer/create-customer-section/create-customer-section.component';
import { CreateBookingSection } from './pages/order-page/sections/create-booking/create-booking-section/create-booking-section.component';
import { ProcessBookingPayment } from './pages/order-page/sections/process-booking-payment/process-booking-payment/process-booking-payment.component';
import { CreateCustomerSectionGuard, CreateBookingSectionGuard, ProcessPaymentSectionGuard } from './pages';
import { ToysPage } from './pages/toys-page/toys-page/toys-page.component';
import { TermsAndConditionsPage } from './pages/terms-and-conditions-page/terms-and-conditions-page/terms-and-conditions-page.component';
import { MyProfilePage } from './pages/my-profile-page/my-profile-page/my-profile-page.component';
const canActivate = [];
export const routes = [{
  path: '',
  redirectTo: 'home',
  pathMatch: 'full'
}, {
  path: 'home',
  component: HomePage,
  canActivate
}, {
  path: 'toys',
  component: ToysPage,
  canActivate
}, {
  path: 'order',
  component: OrderPage,
  canActivate,
  children: [{
    path: '',
    redirectTo: 'step/1',
    pathMatch: 'full'
  }, {
    path: 'step/1',
    component: CreateCustomerSection,
    canActivate: [CreateCustomerSectionGuard]
  }, {
    path: 'step/2',
    component: CreateBookingSection,
    canActivate: [CreateBookingSectionGuard]
  }, {
    path: 'step/3',
    component: ProcessBookingPayment,
    canActivate: [ProcessPaymentSectionGuard]
  }]
}, {
  path: 'about',
  component: AboutPage,
  canActivate
}, {
  path: 'legal',
  component: TermsAndConditionsPage,
  canActivate
}, {
  path: 'myprofile',
  component: MyProfilePage,
  canActivate
}];
